import LogInBar from "./Components/LogInBar";
import Navigation from "./Components/Navigation";
import FooterBar from "./Components/FooterBar";
function ItemPage() {
  return(
    <div>
      <LogInBar/>
      <Navigation/>
      <footer>
        <FooterBar/>
      </footer>
</div>
  );
}

export default ItemPage;
